import './App.css';
import React from 'react';
import FinalDb from './finalDb';
import UserLogin from './userLogin';
import {BrowserRouter as Router,Route,Switch} from 'react-router-dom';
import Finaldoctorsdb from './finaldoctorsdb';






function App() {
  return (
    <div className="page">
      <Router>
        <Switch>
          <Route exact path ='/userLogin' component = {UserLogin}/>
          <Route exact path ='/finaldoctorsdb' component = {Finaldoctorsdb}/>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
